        static string EntityParser(string text)
        {
            var dict = new Dictionary<string, string>
            {
                { "&quot;", "\""},{"&apos;", "'"}, {"&gt;", ">"}, {"&lt;", "<"}, {"&frasl;", "/"}, {"&amp;", "&"}
            };
